    var success = function(text) { return notyMsg({type: 'success', text: text});  }  

    var error = function(text) { return notyMsg({type: 'warning', text: text}); }  
    
    /**
     * Noty Alert box
     * @param - object - Usroptions that overwrite defaults
     **/
    var notyMsg = function(usroptions) 
    {
        // usroptions = array
        var tpl = `
            <div class="noty_message minh3">
                <div class="pad center">
                   <h2 class="noty_text bold"></h2> 
                </div>
                <div class="noty_close">X</div>
            </div>
        `;
        var options = {
            'text': '',
            'layout':'topCenter',
            'theme':'relax',
            'timeout': 5000,
            // success (light green), error (pink), warning (orangey cream), information (lilac), notification (lilac)
            'type':'success', 
                    'buttons':  [
                        {addClass: 'm10 mt0', text: 'Close', onClick: function($noty) { $noty.close(); }}
                    ],
            'template': tpl,
             callback: {
                onShow: function() {},
                afterShow: function() {},
                onClose: function() {},
                afterClose: function() {},
                onCloseClick: function() {}
            }
        };
        options = array_replace(options, usroptions);
        var $noty = noty(options);
        return $noty;
    }

